import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import './App.css';
function App() {
  return (
    <div className="App">
      <nav>
        <h1>Loan Calculator</h1>
        <div>

        <a href="/">Home</a>
        <a href="/about">About</a>
        <a href="/contact">Contact</a>
        <a href="/contact">Contact</a>
        </div>
      </nav>

     <div className="Input">
     <TextField id="outlined-basic" label="Loan Amount" variant="outlined" />
     <TextField id="outlined-basic" label="Interest Rate (%)" variant="outlined" />
     <TextField id="outlined-basic" label="Loan Tenure (Years)" variant="outlined" />
     </div>


     <Button className="button" variant="contained">calculate</Button>

    </div>
  );
}

export default App;
